import React from 'react'
import {SearchOutlined, Notifications} from '@material-ui/icons'

const CardMovie = () => {
  return (
    <div className="container-CardMovie">
      <div className="img-movie-div">
        <img src="https://asset.kompas.com/crops/2vpXZ8VEtMW84mrg5hEzb3tFRF8=/0x0:791x527/750x500/data/photo/2017/11/05/1132136128.jpeg" className="img-movie" />
      </div>
      <div>
        <p>Movie</p>
      </div>
      <style jsx>{`
       .container-CardMovie {
            display: flex;
            flex-direction:column;
       }
       .img-movie-div {
         border-radius: 10px;
         height : 100px;
         width : 50px;

       }

       .img-movie {
        height : 200px;
        width : 100px;
        border-radius: 10px;
       }

        .icon-header {
            font-size:25px;
            font-color:#5a5a5a;
        }
        .search {
            margin-right:50px;
        }
      `}</style>
    </div>
  )
}
export default CardMovie
